    public static ArrayList sixJieXi(String string,Double ChV1,Double ChV0,Double ChAD1,Double ChAD0,Double ZeroV,Double Sensitivity) {
        int length = 4;
        int count = string.length() / length;
        ArrayList<String> array = new ArrayList<String>();
        String str;
        String substring;
        Long value;
        int i = 0;
        double a;
        while (
                i < count
                ) {
            str = string.substring(i * length, (i + 1) * length);
            substring = str.substring(2, 4) + str.substring(0, 2);
            value = Long.parseLong(substring, 16);
            System.out.println(value);
            a = ((ChV1 - ChV0)/(ChAD1 - ChAD0) * (value - ChAD0) + ChV0 - ZeroV) / Sensitivity;
            array.add(i,String.format("%.4f",a));

            {
                i += 1;
            }
        }
        return array;
    }

